Insert into STAGE (ANNEE_PRO,NO_ETUDIANT_NAT,NO_ENTREPRISE,NO_OFFRE,NO_CONTACT_ILI,INTITULE,SUJET,DATE_DEB,DATE_FIN,LIEU,ETAT_STAGE,DESCRIPTION,ETAT_CONVENTION,DATE_SIGNATURE_CONV,NO_ENSEIGNANT,COMMENTAIRE_TUTEUR,DATE_RECEPTION_RAPPORT,NOTE_ENTREPRISE,NOTE_RAPPORT,NO_SESSION,NOTE_SOUTENANCE) 
values ('2004-2005','18986523',8,3,8,'STAGE MAQUETTAGE DE COMPOSANTS D''UN SIMULATEUR D''ENTRAINEMENT NAVAL','STAGE MAQUETTAGE DE COMPOSANTS D''UN SIMULATEUR D''ENTRAINEMENT NAVAL',to_timestamp('04/04/05 00:00:00,000000000','DD/MM/RR HH24:MI:SS,FF'),to_timestamp('31/08/05 00:00:00,000000000','DD/MM/RR HH24:MI:SS,FF'),'Brest','EC','Atos Origin est l''un des principaux acteurs dans les domaines des services informatiques. Sa mission est de traduire la vision stratégique de ses clients en résultats par une meilleure utilisation de solutions de conseil, d''intégration et d''infogérance. Implanté dans 40 pays à travers le monde, Atos Origin réalise un chiffre d''affaires annuel de plus de 5 milliards d''euros avec un effectif supérieur à 46000 personnes. Atos Origin est le partenaire mondial des Jeux Olympiques. Au cSur du groupe Atos Origin, l''activité Systems Integration a pour vocation d''imaginer, de développer et de maintenir les systèmes d''information des entreprises. Le stage s''inscrit dans le cadre du projet PFE Sycops (Système de Combat Commun Barracuda et SNLE SG4) réalisé par Atos Origin pour le compte de la DCN de Brest (secteur défense). Ce projet recouvre l''étude, la réalisation et l''assistance à la mise en phase opérationnelle d''un simulateur d''entraînement et d''instruction pour le personnel navigant à bord des sous-marins nouvelle génération. Les entraînements propres aux élèves, s''effectuent de manière individuelle ou par équipe sur la base de scénarios conduits par un ou plusieurs instructeurs. Les principaux domaines didacticiels sont la détection sous-marine passive, la classification, le management de combat, le lancement des armes ainsi que le débriefing. Intégré au sein d''une équipe, vous serez chargé, à partir des résultats d''études de modélisation (Together sous Eclipse), de maquetter les applications ou les composants associés de type interface utilisateurs et techniques.Les outils qui seront mis en Suvre dans le cadre du stage reposent principalement sur l''atelier de développement Java et notamment Eclipse.L''outil de gestion de configuration sera CVS sous Eclipse.Le domaine fonctionnel concerne principalement la simulation temps réel.> Objectif pédagogique :A l''issue de cette mission, vous aurez développé une bonne approche sur le cycle de vie d''un projet réalisé au forfait et en équipe intégrée (Atos Origin et Thalès Services).La mission se déroulera à Brest. Le projet est réalisé en collaboration avec Thalès services Brest.','ELA',null,null,null,null,null,null,null,null);

