values ('2005-2006','1496024035g',3,2,1,'VoIP','Réalisation de briques réutilisables pour des services VoIP',to_timestamp('04/04/05 00:00:00,000000000','DD/MM/RR HH24:MI:SS,FF'),to_timestamp('31/08/05 00:00:00,000000000','DD/MM/RR HH24:MI:SS,FF'),'Lannion','EC','Dans le cadre de son activité Lannionaise, Teamlog réalise pour ses clients des services basés sur des solutions voix sur IP destiné à des équipements types LiveBox. Ces services nécessitent la mise en Suvre de composants logiciels pour l''émission de vidéo, d''images, de texte et de son sur protocole RTP avec une signalisation SIP. Teamlog souhaite faire réaliser une bibliothèque de composants Java réutilisables par ces différents services. Réalisé en mode projet (spécifications, conception ...) au sein des équipes de Teamlog Lannion, le stage sera organisé avec phase de montée en compétence, prototypage et développement et avec le soutien des experts locaux. Technologies mises en Suvre : Java/J2EE, JMF (Java Media Framework), SIP-Servlet, Eclipse','ELA',null,1,null,null,null,null,1,null);

